const TIBET_BOUNDS = {minLon:73,maxLon:104,minLat:26,maxLat:40};
function inTibet(lat, lon){return lon>=TIBET_BOUNDS.minLon&&lon<=TIBET_BOUNDS.maxLon&&lat>=TIBET_BOUNDS.minLat&&lat<=TIBET_BOUNDS.maxLat;}
function classifyBiome(f){
 const eco=(f.properties.ECO_NAME||'').toLowerCase();
 const biome=(f.properties.BIOME_NAME||'').toLowerCase();
 let lat=null,lon=null;try{const c=L.geoJSON(f).getBounds().getCenter();lat=c.lat;lon=c.lng;}catch(e){}
 if(OVERRIDE_EVERGREEN.some(k=>eco.includes(k))) return 'evergreen_broadleaf';
 if(biome.includes('tropical & subtropical moist broadleaf')) return (lat!==null&&Math.abs(lat)<=23.5)?'rainforest':'evergreen_broadleaf';
 if(eco.includes('evergreen')&&eco.includes('broadleaf')) return 'evergreen_broadleaf';
 if((biome.includes('montane grasslands')||eco.includes('alpine')||eco.includes('plateau'))){return (lat!==null&&lon!==null&&inTibet(lat,lon))?'tundra':'grassland';}
 if(biome.includes('desert')) return 'desert';
 if(biome.includes('savanna')||biome.includes('savannas')||biome.includes('shrublands')){if(biome.includes('tropical')||biome.includes('subtropical')||eco.includes('tropical'))return'tropical_savanna';}
 if(biome.includes('grassland')) return 'grassland';
 if(biome.includes('temperate shrub')||biome.includes('mediterranean')||biome.includes('chaparral')||eco.includes('mediterranean')||eco.includes('chaparral')) return 'temperate_shrub';
 if(biome.includes('temperate broadleaf')||biome.includes('temperate mixed')||biome.includes('temperate conifer')) return 'temperate_forest';
 if(biome.includes('boreal')||biome.includes('taiga')) return 'boreal';
 if(biome.includes('tundra')) return 'tundra';
 return null;
}


function inJapanNonHokkaido(lat,lon,eco){if(lat===null||lon===null)return false;if(lon>=129&&lon<=145&&lat>=30&&lat<=41){if(eco.includes('hokkaido'))return false;return true;}return false;}
function getColor(f){
 const eco=(f.properties.ECO_NAME||'').toLowerCase();
 let lat=null,lon=null;try{const c=L.geoJSON(f).getBounds().getCenter();lat=c.lat;lon=c.lng;}catch(e){}
 if(SPECIAL_OVERRIDES[eco]) return COLORS[SPECIAL_OVERRIDES[eco]];
 if(inJapanNonHokkaido(lat,lon,eco)) return COLORS['evergreen_broadleaf'];
 const cat=classifyBiome(f);
 if(cat&&COLORS[cat]&&ALLOWED_CLIMATES.has(cat)) return COLORS[cat];
 const fb = f.properties.COLOR_BIO || '#AAAAAA';
  // Determine base color (allowed climates or their hex codes)
  let baseColor = (ALLOWED_CLIMATES.has(fb) || ALLOWED_HEX.has(fb)) ? fb : 'rgba(0,0,0,0)';
  // If base color is transparent (i.e., previously hidden), try gap overrides
  if(baseColor==='rgba(0,0,0,0)'){
    const overrideCat = GAP_OVERRIDES[eco];
    if(overrideCat && COLORS[overrideCat]){
       return COLORS[overrideCat];
    }
  }
  return baseColor;
}


// ↑ 保留原本顏色演算，以確保與你「目視看到的顏色」一致（西藏＝苔原、日本本州含寒帶針葉林等）


// 使用者確認的九大目視顏色→名稱（全部轉小寫比較）
const COLOR_NAME_MAP = {
  '#c8c8c8': '苔原',
  '#4f84c4': '寒帶針葉林',
  '#228b22': '溫帶落葉林',
  '#a60a02': '溫帶灌木林',
  '#f2de05': '草原',
  '#fa7325': '沙漠',
  '#00c853': '熱帶莽原',
  '#0b6623': '熱帶雨林',
  '#6b8e23': '常綠闊葉林'
};
function nameFromColor(hex){ if(!hex) return null; hex=hex.toLowerCase(); return COLOR_NAME_MAP[hex] || null; }



// === 建立地圖 ===
const map = L.map('map',{zoomControl:true}).setView([20,0],2);
var worldBounds=L.latLngBounds([[-70,-180],[90,180]]);
// 依使用者要求 zoom+1：讓藍色水域收斂，視圖更貼近陸地
map.fitBounds(worldBounds,{padding:[40,20],animate:false});
var _ctr=map.getCenter();
var targetZoom=map.getZoom()+1; // 比 fit 結果放大一級
map.setView(_ctr,targetZoom,{animate:false});
map.setMinZoom(targetZoom);
map.setMaxBounds(worldBounds);
// no basemap; background blue



// === 使用原始顏色運算（getColor）繪圖，但僅依最終顏色提供互動 ===
const biomeLayer = L.geoJSON(biomeDataFiltered,{
  style: function(f){
    let c = getColor(f) || 'rgba(0,0,0,0)';
    // 色彩更新：舊色 → 新色 (沙漠/草原/溫帶灌木林)
    if(typeof c==='string'){
      const lc=c.toLowerCase();
      if(lc==='#f2e36b') c='#fa7325';
      else if(lc==='#d1b35c') c='#f2de05';
      else if(lc==='#c85a17') c='#a60a02';
    }
    // --- Yukon patch 與 Caribbean patch --- 原有程式略
    let _c = c;
    if(!(typeof _c==='string' && _c.startsWith('#'))){
      try{
        const _ctr=L.geoJSON(f).getBounds().getCenter();
        // Yukon
        if(_ctr.lat>=58 && _ctr.lat<=70 && _ctr.lng>=-143 && _ctr.lng<=-122){_c='#4F84C4';}
        // Caribbean
        else if(_ctr.lat>=15 && _ctr.lat<=25 && _ctr.lng>=-86 && _ctr.lng<=-64){_c='#00C853';}
        // 其他未知：使用淺灰陸地色，避免看起來像海
        else {_c='#e0e0e0';}
      }catch(e){_c='#e0e0e0';}
    }
    const cFinal=_c;

    f.properties.__colorUsed = (typeof cFinal==='string' && cFinal.startsWith('#')) ? cFinal.toLowerCase() : cFinal;
    return {
      color: 'transparent',
      weight: 0,
      stroke: false,
      fillColor: cFinal,
      fillOpacity: 0.75
    };
  },
  onEachFeature: function(f,layer){
    
layer.on('click', function(){
  const colorHex=(this.feature&&this.feature.properties&&this.feature.properties.__colorUsed)||this.options.fillColor||'';
  const name=nameFromColor(colorHex);
  if(!name)return;
  openTeachingPanel(name,colorHex);
});
layer.on('mouseover',function(e){
  const colorHex=(this.feature&&this.feature.properties&&this.feature.properties.__colorUsed)||this.options.fillColor||'';
  const name=nameFromColor(colorHex);
  if(!name)return;
  showHoverTooltip(name,e);
});
layer.on('mousemove',moveHoverTooltip);
layer.on('mouseout',hideHoverTooltip);

  }
}).addTo(map);

// === 點擊圖例開啟面板 ===
function buildLegend(map){
  const div = L.DomUtil.create('div','info legend');
  Object.entries(COLOR_NAME_MAP).forEach(([hex,name])=>{
    const item = L.DomUtil.create('div','legend-item',div);
    const swatch = L.DomUtil.create('span','legend-swatch',item);
    swatch.style.background = hex;
    const label = L.DomUtil.create('span','legend-label',item);
    label.textContent = name;
    item.style.cursor = 'pointer';
    item.addEventListener('click',()=>openTeachingPanel(name, hex));
  });
  return div;
}
const legendControl = L.control({position:'bottomright'});
legendControl.onAdd = buildLegend;
legendControl.addTo(map);
// === 教學面板 ===
const panelWrap = document.getElementById('teaching-panel-wrapper');
const panelTitle = document.getElementById('panel-title');
const panelContent = document.getElementById('panel-content');
const hoverTip = document.getElementById('hover-tooltip');
function showHoverTooltip(name, evt){
  if(!name) return;
  hoverTip.textContent = name;
  hoverTip.style.left = (evt.originalEvent.pageX + 12) + 'px';
  hoverTip.style.top  = (evt.originalEvent.pageY + 12) + 'px';
  hoverTip.classList.add('visible');
  hoverTip.setAttribute('aria-hidden','false');
}
function moveHoverTooltip(evt){
  if(!hoverTip.classList.contains('visible')) return;
  hoverTip.style.left = (evt.originalEvent.pageX + 12) + 'px';
  hoverTip.style.top  = (evt.originalEvent.pageY + 12) + 'px';
}
function hideHoverTooltip(){
  hoverTip.classList.remove('visible');
  hoverTip.setAttribute('aria-hidden','true');
}

const panelClose = document.getElementById('panel-close');
function closeTeachingPanel(){document.body.classList.remove('panel-open');}
panelClose.addEventListener('click',closeTeachingPanel);
document.addEventListener('keydown',e=>{if(e.key==='Escape'){closeTeachingPanel();}});


function openTeachingPanel(title, hex){
  panelTitle.textContent = title;
  panelContent.innerHTML = `<p>這裡可以放「${title}」的教學內容。</p>`;
  document.body.classList.add('panel-open');
}
